import ExpanseItem from "./components/ExpanseItem";
function App() {
  const expanse = [
    { title: "Television", amount: 220, date: new Date(2021, 10, 10) },
    { title: "Car insaurance", amount: 1000, date: new Date(2021, 9, 18) },
    { title: "Table", amount: 420, date: new Date(2021, 11, 11) },
    { title: "Computer System", amount: 870, date: new Date(2020, 10, 10) },
  ];
  return (
    <div>
      <ExpanseItem
        title={expanse[0].title}
        amount={expanse[0].amount}
        date={expanse[0].date}
      ></ExpanseItem>
      <ExpanseItem
        title={expanse[1].title}
        amount={expanse[1].amount}
        date={expanse[1].date}
      ></ExpanseItem>
      <ExpanseItem
        title={expanse[2].title}
        amount={expanse[2].amount}
        date={expanse[2].date}
      ></ExpanseItem>
      <ExpanseItem
        title={expanse[3].title}
        amount={expanse[3].amount}
        date={expanse[3].date}
      ></ExpanseItem>
    </div>
  );
}

export default App;
